import React, {useContext} from "react";
import {Button} from "antd";

import Sidenav from "../../components/Sidenav"
import {DataSessionContext, DataUserContext} from "../../utils";
import {Link} from "react-router-dom";



export default function HomeAdmin(props) {

    const session = useContext(DataSessionContext)
    const user = useContext(DataUserContext)

    return (
            <div className="app--wrapper">
                <div className="sidenav--wrapper my-primary-color">
                    <ul className="sidenav--header">
                        <li className="sidenav-nav-link active"><Link to="/root"><MdHome/></Link></li>
                        <li className="sidenav-nav-link"><Link to="/stations"><MdApps/></Link></li>
                        <li className="sidenav-nav-link"><Link to="/customers"><MdPeople/></Link></li>
                        <li className="sidenav-nav-link"><Link to="/notifications"><MdNotifications/></Link></li>
                    </ul>
                    <ul className="sidenav--footer">
                        <li className="sidenav-nav-link"><Link to="/profile"><MdAccountCircle/></Link></li>
                        <li className="sidenav-nav-link"><Link to="/setting"><MdSettings/></Link></li>
                        <li className="sidenav-nav-link"><Link to="/logout"><MdPowerSettingsNew/></Link></li>
                    </ul>
                </div>
                <div className="app--content">
                    {/*<Switch>*/}
                    {/*    <Route exact path="/" component={Home}/>*/}
                    {/*    <Route exact path="/about" component={About}/>*/}
                    {/*    <Route exact path="/contact" component={Contact}/>*/}
                    {/*</Switch>*/}
                   <p>Je suis dans l'admin <Button type="danger" onClick={() => props.history.push("/logout")}>Déconnexion</Button></p>
                </div>
            </div>
    )
}
